import { Link } from "react-router-dom";
export const Navigation = ({languages}) => {
    return (
        <ul>
            {
                languages.map((x) =>
                    <li>
                        <Link to={``}>{x}</Link>
                    </li>
                )
            }
            <li><Link to="/">Home</Link></li>
            <li>
                <Link to="/react">React</Link>
            </li>
            <li>
                <Link to="/vue">Vue</Link>
            </li>
            <li>
                <Link to="/angular">Angular</Link>
            </li>
        </ul>
    );
}
